function restructure(arg, marker) {
	function reduceKeyValue(arr) {
		/*
		IN: 
			[
...                         {
...                             "key": "site",
...                             "value": "youtube.com"
...                         },
...                         {
...                             "key": "site2",
...                             "value": "instagram.com"
...                         }
...                     ]

		OUT:
			{ site: 'youtube.com', site2: 'instagram.com' }

		*/
		return arr.reduce((acc, c) => ((acc[c.key] = c.value), acc), {});
	}

	function process(item) {
		// process the container of key-value objects

		if (Array.isArray(item)) {	// as in `documents`
			return reduceKeyValue(item);
		}

		if (Object.keys(item).includes(marker) && Array.isArray(item[marker])) {	// as in `connections` and `tools`
			const obj = { ...item };
			obj[marker] = reduceKeyValue(item[marker]);
			return obj;
		}
		return item;
	}

	return Array.isArray(arg) ? arg.map(process) : process(arg);
}

