function parseJsonSchema(jsonString) {
    function defineType(value) {
        if (Array.isArray(value)) {
            if (value.length === 0) {
                return { type: 'array', items: { type: 'string' } };
            }

            const types = value.map(defineType);
            const uniqueTypes = Array.from(new Set(types.map(JSON.stringify))).map(JSON.parse);

            return {
                type: 'array',
                items: uniqueTypes.length === 1 ? uniqueTypes[0] : { anyOf: uniqueTypes },
            };
        } else if (value === null) {
			return { type: 'string' };
		}

		switch (typeof value) {
			case 'object':
				return generateSchema(value);
			case 'number':
				return Number.isInteger(value) ? { type: 'integer' } : { type: 'number' };
			case 'boolean':
				return { type: 'boolean' };
			default:
				return { type: 'string' };
		}
	}

	function generateSchema(obj) {
		const schema = {
			type: 'object',
			properties: {},
			required: [],
			additionalProperties: false,
		};

		for (const key in obj) {
			if (obj.hasOwnProperty(key)) {
				schema.properties[key] = defineType(obj[key]);
				schema.required.push(key);
			}
		}

		return schema;
	}

	try {
		const parsed = JSON.parse(jsonString);
        const schema = generateSchema(parsed);
		return JSON.stringify(schema, null, 2);
	} catch (err) {
		throw new Error('Invalid JSON input: ' + err.message);
	}
}

