function processResponseFormat(responseFormat) {
    if (!responseFormat || typeof responseFormat !== "object") return;

    const { type, json_schema } = responseFormat;

    if (!type) {
        return { type: 'text' };
    } else if (!json_schema) {
        return { type };
    }

    try {
        const parsedSchema = JSON.parse(json_schema);

        return {
            ...responseFormat,
            json_schema: parsedSchema,
        };
    } catch (err) {
        throw new Error("Invalid JSON schema: " + err.message);
    }
}

